import React from "react";

const RegisterFormContainer = () => {
  return (
    <form>
      <input type="text" placeholder="Username" />
      <input type="password" placeholder="Password" />
      <button type="submit">Register</button>
    </form>
  );
};

export default RegisterFormContainer;
